svg.script:
(function() {
var svg = document.getElementById('Layer_1');
// console.log(svg);
var tooltip = svg.getElementById('tooltip');
var tooltipText = tooltip.getElementsByTagName('text')[0];
console.log(tooltipText.firstChild);
var triggers_rect = svg.getElementsByClassName('r');
var triggers_dots = svg.getElementsByClassName('n');
console.log(triggers_rect);
console.log(triggers_dots);
for (var i = 0; i < triggers_rect.length; i++) {
	triggers_rect[i].addEventListener('mousemove', showTooltip);
	triggers_rect[i].addEventListener('mouseout', hideTooltip);
}
for (var i = 0; i < triggers_dots.length; i++) {
	triggers_dots[i].addEventListener('mousemove', showTooltip);
	triggers_dots[i].addEventListener('mouseout', hideTooltip);
}
function showTooltip(evt) {
	var CTM = svg.getScreenCTM();
	var length = tooltipText.getComputedTextLength();
	var x = (evt.clientX - CTM.e - length/2) / CTM.a;
	var y = (evt.clientY - CTM.f - 35) / CTM.d;
	tooltip.setAttributeNS(null, "transform", "translate(" + x + " " + y + ")");
	tooltip.setAttributeNS(null, "visibility", "visible");
	tooltipText.firstChild.data = evt.target.getAttributeNS(null, "t");
	var tooltipRects = tooltip.getElementsByTagName('rect');
	for (var i = 0; i < tooltipRects.length; i++) {
		tooltipRects[i].setAttributeNS(null, "width", length + 8);
	}
}
function hideTooltip(evt) {
	tooltip.setAttributeNS(null, "visibility", "hidden");
}
})()
